   * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2404087","type":"CustomJS"},{"attributes":{"coordinates":null,"data_source":{"id":"2403826"},"glyph":{"id":"2403827"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"2403829"},"nonselection_glyph":{"id":"2403828"},"view":{"id":"2403831"}},"id":"2403830","type":"GlyphRenderer"},{"attributes":{"line_color":{"field":"returns_positive","transform":{"id":"2403703"}},"line_dash":{"value":"dotted"},"line_width":{"value":8},"xs":{"field":"position_lines_xs"},"ys":{"field":"position_lines_ys"}},"id":"2403974","type":"MultiLine"},{"attributes":{"format":"0.[00]%"},"id":"2403902","type":"NumeralTickFormatter"},{"attributes":{"label":{"value":"macd(C,12,26,9)"},"renderers":[{"id":"2404050"}]},"id":"2404063","type":"LegendItem"},{"attributes":{"data":{"Close":{"__ndarray__":"FK5H4XqUS0A9CtejcF1LQOF6FK5HgUtAH4XrUbg+S0AAAAAAAABLQB+F61G4/kpAhetRuB5FSkBxPQrXo1BKQIXrUbgeRUpAcT0K16OwSkDsUbgehWtKQPYoXI/C9UlA16NwPQqXSUDXo3A9CldJQMP1KFyPgklAw/UoXI9CSUDhehSuRwFJQHE9CtejcEpAuB6F61G4SkCuR+F6FG5LQGZmZmZmhktAH4XrUbi+S0DXo3A9ChdMQHsUrkfh2ktAUrgeheuRS0BxPQrXo7BLQFK4HoXrEUxAAAAAAAAgTEDhehSuR8FLQOxRuB6Fa0tA7FG4HoVrS0DXo3A9CvdKQMP1KFyPIktA16NwPQqXS0DXo3A9CtdLQKRwPQrXY0xAAAAAAAAgTECPwvUoXG9MQKRwPQrXg0xAhetRuB7FTEAzMzMzM9NMQMP1KFyPAk1Aw/UoXI/iTEAUrkfherRMQKRwPQrXw0xA7FG4HoXLTEAfhetRuP5MQGZmZmZmJk1ASOF6FK4nTUAK16NwPWpMQFK4HoXr0UxAAAAAAADATEAAAAAAAIBMQHsUrkfhmkxAcT0K16MwTUBmZmZmZmZNQGZmZmZmhk1AZmZmZmamTUC
